column8:
■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">紫外線の強さが一目でイメージできるハットクリップ。ＵＶチェッカーのチャームが、日にあたると紫外線の強さに応じて、だんだんと濃い紫色に！帽子に付けることでいつでも紫外線の強さをチェックでき、うっかり日焼けを防ぎます。人気の天然石（タイガーアイ・水晶）や革ひも風のコードをほどこし、オシャレ感覚でも。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">全長：約60cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">合成樹脂、タイガーアイ、水晶、合成皮革、真鍮、鉄</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><style type="text/css">
